import Calendar from "react-calendar";
import "./Calendar.css"; // css import

import React, { Component } from "react";
import SimpleReactCalendar from "simple-react-calendar";

function MyCalendar() {
  return (
    <>
      <Calendar />
      <SimpleReactCalendar />
    </>
  );
}

export default MyCalendar;
